import React from "react";

import * as Styled from "./style";
import Tr from "../Tr";
import Th from "../Th";
import Td from "../Td";

const Table = ({ headData, bodyData }) => {
  let renderTableHeadData = () =>
    headData.map((data, i) => (
      <Th key={i} pad={[2, 0]} width={data.width}>
        {data.name}
      </Th>
    ));

  let renderTableBodyData = () =>
    bodyData.map((data) => (
      <React.Fragment>
        <Td>{data.id}</Td>
        <Td>{data.title}</Td>
        <Td>{data.user}</Td>
        <Td>{data.date}</Td>
      </React.Fragment>
    ));

  return (
    <Styled.Table>
      <thead>
        <Tr>{renderTableHeadData()}</Tr>
      </thead>
      <tbody>
        <Tr bordered>{renderTableBodyData()}</Tr>
      </tbody>
    </Styled.Table>
  );
};

export default Table;
